import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import { Header } from './Header';
import './index.css';
import Sdata from './Sdata';


ReactDOM.render(
    <React.Fragment>

        {/* header component */}
        <Header />


        {/* main card component */}
        <div className="cards">

            {/* <Card sname={Sdata[0].sname}
            imgsrc={Sdata[0].imgsrc}
            title={Sdata[0].title}
            link={Sdata[0].links}   
            /> */}

            {Sdata.map((elements) => {
                <Card sname={elements.sname}
                imgsrc={elements.imgsrc}
                title={elements.title}
                link={elements.links}   
            />
            })}

        </div>
    </React.Fragment>,
    document.getElementById('root')
);
